using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Microsoft.Maui.Controls;

namespace ImageSourceIssue.ViewModel
{
    public class MainViewModel : INotifyPropertyChanged
    {

        // Обработчик события изменения данных свойстве (коллекции)
        public event PropertyChangedEventHandler PropertyChanged;

        private void OnPropertyChanged(string propertyName)
        {
            PropertyChanged?.Invoke(this, new PropertyChangedEventArgs(propertyName));
        }

        public string base64image = "";
        private ImageSource _testImage;
        public ImageSource TestImage
        {
            get { return _testImage; }
            set
            {
                _testImage = value;
                OnPropertyChanged(nameof(TestImage));
            }
        }


        public MainViewModel() { }
    }
}
